@Git Center: Zites that I use (which aren't mine): ZeroTalk, ZeroID, ZeroMail, ZeroMe, etc.
&nbsp;
And yeah, I'd probably use more zites if these zites had more data/information. Think about it.. Facebook has so many users on it, that it could be considered a country in and of its own. 
&nbsp;
What we're doing here is literally, starting our own digital country.. with different laws from the rest. That's gonna take a hell of a lot of time!
